async function getServerStatus() {
    // Declare an Array of servers that have errors.
    let serversWithErrors = [];
    let serverNumber = 0;
    while(true){
        // Increment the server number.
        serverNumber++;
	if(serverNumber>20){
            await console.log(`Maximum number of servers has been reached (` + serverNumber + `).`);
            break;
        }
        // See if the Server element exists.
        const serverElement = await driver.findElements(By.css(`#name` + serverNumber + ` > a`));
        // If the server name is not found, then exit the function.
        if(serverElement.length == 0){
            await console.log(`No more servers found.`);
            break;
        }
        // Get the Name of the server.
        const serverName = await driver.findElement(By.css(`#name` + serverNumber + ` > a`)).getText();
        await console.log(`Server ` + serverNumber + ` Name is ` + serverName);
        // Get the State of the server.
        const serverState = await driver.findElement(By.id(`state` + serverNumber)).getText();
        await console.log(`Server ` + serverNumber + ` State is ` + serverState);
        // Get the Health of the server.
        const serverHealth = await driver.findElement(By.id(`health` + serverNumber)).getText();
        await console.log(`Server ` + serverNumber + ` Health is ` + serverHealth);
        if(serverState != `RUNNING` || serverHealth.match(/.{2}$/) != `OK`){
            await console.log(`Server ` + serverName + `Status FAILED. State: ' + serverState + ' Health:` + serverHealth);
            serversWithErrors.push(serverName + `: State="` + serverState + `" Health="` + serverHealth + `"`);
        }
    }
    await assert.equal(serversWithErrors.length, 0, "The following server(s) have errors:\n" + serversWithErrors.join("\n"));
}
